SELECT @ModuleId := id FROM `admin_modules` WHERE name='admin';
-- Last controller id.
SELECT @ControllerId := MAX(id) FROM `admin_controllers`;
-- Last menu id.
SELECT @MenuId := MAX(id) FROM `admin_menu`;
SET @ControllerId_city                      = @ControllerId + 1;
SET @ControllerId_district                  = @ControllerId + 2;
SET @ControllerId_ward                      = @ControllerId + 3;
SET @ControllerId_street                    = @ControllerId + 4;




DROP TABLE IF EXISTS `admin_address_nations`;
CREATE TABLE `admin_address_nations` (
    `id`            smallint(5) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'Id',
    `name`          varchar(256) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Name',
    `name_en`       varchar(256) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '-' COMMENT 'Name of nation (EN)',
    `description`   text CHARACTER SET utf8 COLLATE utf8_unicode_ci COMMENT 'Description',
    `code_no`       varchar(10) NOT NULL DEFAULT '0' COMMENT 'Code of nation',
PRIMARY KEY ( `id` )
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 COMMENT='Nations';


DROP TABLE IF EXISTS `admin_address_cities`;
CREATE TABLE `admin_address_cities` (
    `id`            smallint(5) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'Id',
    `nation_id`     smallint(5) UNSIGNED NOT NULL DEFAULT 0,
    `name`          varchar(256) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Name',
    `short_name`    varchar(150) DEFAULT NULL,
    `slug`          varchar(150) DEFAULT NULL,
    `code_no`       varchar(10) NOT NULL DEFAULT '0',
    `status`        tinyint(1) UNSIGNED NOT NULL DEFAULT '1',
PRIMARY KEY ( `id` )
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 COMMENT='Cities';


DROP TABLE IF EXISTS `admin_address_districts`;
CREATE TABLE `admin_address_districts` (
    `id`            mediumint(5) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'Id',
    `city_id`       smallint(5) UNSIGNED NOT NULL,
    `name`          varchar(256) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Name',
    `short_name`    varchar(150) DEFAULT NULL,
    `slug`          varchar(150) DEFAULT NULL,
    `code_no`       varchar(10) NOT NULL DEFAULT '0',
    `status`        tinyint(1) UNSIGNED NOT NULL DEFAULT '1',
PRIMARY KEY ( `id` )
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 COMMENT='Districts';


DROP TABLE IF EXISTS `admin_address_wards`;
CREATE TABLE `admin_address_wards` (
    `id`            mediumint(7) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'Id',
    `district_id`   mediumint(5) UNSIGNED NOT NULL COMMENT 'Id of district',
    `name`          varchar(256) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Name',
    `short_name`    varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL,
    `slug`          varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL,
    `code_no`       varchar(10) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
    `status`        tinyint(1) UNSIGNED NOT NULL DEFAULT '1',
PRIMARY KEY ( `id` )
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=1 COMMENT='Wards';


DROP TABLE IF EXISTS `admin_address_streets`;
CREATE TABLE `admin_address_streets` (
    `id`            int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'Id',
    `city_id`       smallint(5) UNSIGNED NOT NULL,
    `name`          varchar(256) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Name',
    `short_name`    varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Short name',
    `slug`          varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL,
    `status`        tinyint(1) NOT NULL DEFAULT '1',
PRIMARY KEY ( `id` )
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=1 COMMENT='Streets';